import React from "react";
import Navbar from "../../components/Navbar/Navbar";
import { Apis } from "../../components/RequestApi";
import Banner from "../../components/Banner/Banner";
import classes from './Browse.module.css';

const Browse = () => {
  const {
    trendDings,
    netflixOriginals,
    topRated,
    actionMovies,
    comedyMovies,
    horrorMovies,
    romanceMovies,
    documentaries,
  } = Apis();
  return (
    <div className="app">
      {/* NavBar Website */}
      <Navbar />

      {/* Banner Website */}
      <Banner />

      {/* Categories films */}

      {/* NetFlix originals  */}

      <section className={classes}>
        <span></span>
      </section>
    </div>
  );
};

export default Browse;
